import logo from "../../static/hiish.svg";
import React, { useState, useEffect } from 'react';

function LoginContent() {
    return (
        <div className="p-10 flex flex-col items-center" style={{width: "70%", marginLeft: '20%'}}>
            <img className="p-5" src={logo} />
            <div className="flex flex-col">
                <p>Login</p>
                <p>Welcome to Hiish!(a fake wechat on browser) Hi!(ish)</p>
                <input className="border-2" placeholder="type anything, not specifically the word anything" type="text"/>
                <input className="border-2" placeholder="just set 123456 as the password" type="password" />
            </div>
        </div>
    );
}

export default LoginContent;
